import { ArchiveBoxArrowDownIcon, DonarIcon } from "../../../shared/Icons";

export const donarMenue = [
  {
    name: "Orgnaisations",
    href: "/orgnaisation",
    icon: ArchiveBoxArrowDownIcon,
    current: true,
  },
  { name: "Donations", href: "/donation", icon: DonarIcon, current: false },
];
